import React from 'react';
import './rectangle.css';
import { FaGraduationCap } from 'react-icons/fa';

const Rectangle = ({ status, user, props }) => (

    <div className="rectangle">
        <h1 className="activities-rectangle__quantity">{props.quantity}</h1>
        <p className="activities-rectangle__enrolledCourses">{props.status}</p>
        <div> </div>
    </div>
)

export default Rectangle;
